import React from 'react';

export default function ParkingLots({lowestLots}){
    if(!lowestLots){
        return(<h1>Searching for entered city...</h1>);
    } else {
        return (
            <div>
                {lowestLots && lowestLots.map((lot)=>{
                    return (
                        <div key={lot.name}>
                            <h1>{lot.name}</h1>
                            <img width="200px" height="200px" scr={lot.image_url} alt="lot image"></img>
                            <h4>Address: {lot.address}</h4>
                        </div>
                    );
                })}
            </div>
        );
    }
}
